var React = require("react");
var DefaultLayout = require('./defaultlayout');

class ViewCart extends React.Component {
  render() {
    let cart = this.props.cart.map( (cart) => {
        return (

            <div>
            <table className="table table-hover justify-content-center w-75">
              <tbody>
                    <tr>
                      <td>{cart.id}</td>                  
                      <td>{cart.items_id}</td>
                      <td>{cart.name}</td>
                      <td>{cart.price}</td>
                      <td>{cart.quantity}</td>

                      <td><a href={"/cart/" + cart.items_id+"/edit"}>Edit</a></td>
                    </tr>
                </tbody>
                </table>  
            </div>

            );

    });
    return (
          <DefaultLayout>
            <div>

              <h2> Cart Homepage</h2>
              <table className="table table-hover justify-content-center w-75">
              <thead className="thead-light">
                  <tr>
                    <th scope="col">Count</th>
                    <th scope="col">Item ID</th>
                    <th scope="col">Item Name</th>
                    <th scope="col">Price</th>
                    <th scope="col">Quantity</th>
                    <th scope="col">Action</th>
                  </tr>
              </thead>

              <tr>
                {cart}
              </tr>
              </table>
              <label> Total Cost </label>
              <div className="totals-value" id="cart-total"> </div> <br />
              <button><a href="/summary">Checkout</a> </button>
            </div>
            </DefaultLayout>
    );
  }
}

module.exports = ViewCart;
